    public class SignService : ApplicationService, ISignService
    {
        private readonly ISignGrpcClient _signGrpcClient;
        private readonly IOrderReportService _orderReportService;
        public SignService(ISignGrpcClient signGrpcClient, IOrderReportService orderReportService)
        {
            _signGrpcClient = signGrpcClient;
            _orderReportService = orderReportService;
        }

        public async Task<IDataResult<string>> ContractSign(int orderId, string title)
        {
            var contractReport = await _orderReportService.RptOrderDetail(orderId, OrderConstant.ContractReportName);
            var signContract = await _signGrpcClient.CreateSign(new CreateSignGrpcClientRequest()
            {
                Title = title,
                Description = "",
                DocumentName = "Contract.pdf",
                DocumentData = contractReport,
                DocumentParameter = "{\"dataFields\":[{\"dataFieldType\":\"SIGNATURE\",\"pageNumber\":1,\"tag\":\"2702031574200\",\"topRel\":0.85,\"leftRel\":0.136,\"heightRel\":0.16168149,\"widthRel\":0.22857143}],\"signatureImageTextParameter\":{\"customText\":\"امضا\",\"name\":true,\"signDate\":true}}",
                RecipientUsername = "0001001000"
            });
            string _ticketId = "";
            if (signContract.Success)
            {
                var responseBody = JsonConvert.DeserializeObject<List<CreateSignResponseBodies>>(signContract.ResponseBody);
                return new SuccsessDataResult<string>(_ticketId);
            }
            else
            {
                throw new UserFriendlyException(signContract.Message, signContract.ResultCode.ToString());
            }
        }


